    false,nt"url": null,nt"notes": "This data set consists of land derived
    from high resolution imagery and was analyzed according to the Coastal Change Analysis
    Program (C-CAP) protocol to determine land cover. This data set utilized Quickbird
    multispectral scenes which were processed to detect C-CAP land cover features on
    the coastal areas of the Big Island of Hawaii. Due to the size of the area mapped
    and the frequency of cloud cover across the region dates of the Quickbird scenes
    ranged from early 2002 to early 2009. Imagery was selected for least cloud cover,
    overall quality and most recent date possible.",nt"license_title": null,nt"extras":
